import React, { useState } from "react";
import { Helmet } from "react-helmet";
import { Button } from "./../components/Button";
import { Link, Navigate } from "react-router-dom";
import axios from "../api/axios";

export const Register = () => {
  const [nama, setNama] = useState("");
  const [nikk, setNikk] = useState("");
  const [alamatKtp, setAlamatKtp] = useState("");
  const [pekerjaan, setPekerjaan] = useState("");
  const [contact, setContact] = useState("");
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [confirmPassword, setConfirmPassword] = useState("");
  const [errMsg, setErrMsg] = useState("");
  const [success, setSuccess] = useState(false);

  const REGISTER_URL = "/register";

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await axios.post(
        REGISTER_URL,
        JSON.stringify({
          nama: nama,
          nikk: nikk,
          contact: contact,
          alamatKtp: alamatKtp,
          pekerjaan: pekerjaan,
          email: email,
          password: password,
        }),
        {
          headers: { "Content-Type": "application/json" },
        }
      );

      if (response?.data) {
        //variabelconditional= objek data tidak ada(dianggap false), kalau ada(dicek variabel true/false)
        const status = response.data.status;
        console.log(status);
        setSuccess(true);
      }
    } catch (e) {
      if (!e?.response) {
        setErrMsg("tidak ada response dari server");
      } else if (e?.response.status !== 201) {
        setErrMsg(e?.response?.data?.message);
      }
    }
  };

  return success ? (
    <Navigate to="/login" />
  ) : (
    <>
      <Helmet>
        <title>Register</title>
      </Helmet>
      <div className="grid grid-cols-2 mb-2 ">
        <div className="bg-loginpic h-auto">
          <Link to="/" className="p-4 text-white text-3xl bg-[#29b2ff] ">
            ‚Üê
          </Link>
        </div>
        <div className="m-auto">
          <h1 className="text-4xl pb-5 font-bold text-[#29b2ff] text-center">
            Register
          </h1>
          {errMsg ? <span>{errMsg}</span> : ""}
          <form
            onSubmit={handleSubmit}
            action="/register"
            method="post"
            className="grid grid-rows-3 gap-4 w-80 h-90"
          >
            <input
              type="text"
              name="name"
              className="border-solid border-2 radius p-2 rounded-md"
              placeholder="Username"
              value={nama}
              onChange={(e) => {
                setNama(e.target.value);
              }}
            />
            <input
              type="text"
              name="name"
              className="border-solid border-2 radius p-2 rounded-md"
              placeholder="nomor induk kartu keluarga"
              value={nikk}
              onChange={(e) => {
                setNikk(e.target.value);
              }}
            />
            <input
              type="text"
              name="name"
              className="border-solid border-2 radius p-2 rounded-md"
              placeholder="alamat KTP"
              value={alamatKtp}
              onChange={(e) => {
                setAlamatKtp(e.target.value);
              }}
            />
            <input
              type="text"
              name="name"
              className="border-solid border-2 radius p-2 rounded-md"
              placeholder="Pekerjaan"
              value={pekerjaan}
              onChange={(e) => {
                setPekerjaan(e.target.value);
              }}
            />
            <input
              type="text"
              name="name"
              className="border-solid border-2 radius p-2 rounded-md"
              placeholder="Contact"
              value={contact}
              onChange={(e) => {
                setContact(e.target.value);
              }}
            />
            <input
              type="text"
              name="name"
              className="border-solid border-2 radius p-2 rounded-md"
              placeholder="email"
              value={email}
              onChange={(e) => {
                setEmail(e.target.value);
              }}
            />
            <input
              type="password"
              name="name"
              className="border-solid border-2 p-2 rounded-md"
              placeholder="Password"
              value={password}
              onChange={(e) => {
                setPassword(e.target.value);
              }}
            />
            <input
              type="password"
              name="name"
              className="border-solid border-2 p-2 rounded-md"
              placeholder="Confirm Password"
              value={confirmPassword}
              onChange={(e) => {
                setConfirmPassword(e.target.value);
              }}
            />

            <Button text="submit" onClick={Register} />
          </form>
        </div>
      </div>
    </>
  );
};
